book_date_213.cellBackground:
{{(() => { const tableData = data_table.processedTableData || []; return tableData.length > 0 ? tableData.map((currentRow, currentIndex) => (
(() => {
  const currentTime = new Date();
  const settings = R_SETTING.data[0];

  if (currentRow.case_type == 2) {
    return '#eeefef';
  }

  if (currentRow.prelim_result !== 2) {
    const prelimDeadline = new Date(currentRow.prelim_deadline);
    const daysUntilPrelimDeadline = Math.ceil((prelimDeadline - currentTime) / (1000 * 60 * 60 * 24));

    if (currentRow.prelim_status == 8 || (currentRow.prelim_result !== 0 && currentRow.prelim_result !== 1)) {
      return '#27ae60';
    }
    if (daysUntilPrelimDeadline <= settings.prelim_warning && daysUntilPrelimDeadline >= 0) {
      return '#fff3cd';
    }
    if (daysUntilPrelimDeadline < 0) {
      return '#d9534f';
    }
    return '#ffffff';
  }

  const invesDeadline = new Date(currentRow.inves_deadline);
  const daysUntilInvesDeadline = Math.ceil((invesDeadline - currentTime) / (1000 * 60 * 60 * 24));

  if (currentRow.inves_status == 7) {
    return '#27ae60';
  }
  if (daysUntilInvesDeadline <= settings.inves_warning && daysUntilInvesDeadline >= 0) {
    return '#fff3cd';
  }
  if (daysUntilInvesDeadline < 0) {
    return '#d9534f';
  }
  return '#ffffff';
})()
)) : 
